import React, { useState, useEffect } from "react";
import { Link, NavLink } from "react-router-dom";

const images = [
  "https://ensembleias.com/blog/wp-content/uploads/sites/2/2022/10/ONE-NATION-ONE-FERTILIZER-Unification-of-fertilizer-brands.jpg",
  "https://bl-i.thgim.com/public/incoming/ss2xtq/article67815303.ece/alternates/FREE_1200/IIL.jpeg",
  "https://utkarshagro.com/cdn/shop/files/Artboard_3_1.png?v=1720763726&width=750",
];

const categories = [
  {
    name: "Seeds",
    image:
      "data:image/jpeg;base64,",
    slug: "seeds",
  },
  {
    name: "Insecticide",
    image:
      "data:image/jpeg;base64,",
    slug: "insecticide",
  },
  {
    name: "Fertilizer",
    image:
      "https://th.bing.com/th/id/OIP.QQ1Osg4JZycNwC_g1vBfcwHaHa?w=148&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7",
    slug: "fertilizer",
  },
  {
    name: "Irrigations",
    image:
      "https://th.bing.com/th/id/OIP.vk4oJo-Eedh--CGKyvE_2wHaHa?w=178&h=180&c=7&r=0&o=5&dpr=1.3&pid=1.7",
    slug: "irrigations",
  },
  {
    name: "Crop Commodities",
    image:
      "data:image/jpeg;base64,",
    slug: "crop-commodities",
  },
  {
    name: "Agro Products",
    image:
      "data:image/jpeg;base64,",
    slug: "agro-roducts",
  },
];

const AllProducts = () => {
  const [currentImage, setCurrentImage] = useState(0);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    const timer = setInterval(() => {
      setCurrentImage((prevImage) => (prevImage + 1) % images.length);
    }, 3000);
    return () => clearInterval(timer);
  }, []);

  const filteredCategories = categories.filter((category) =>
    category.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="min-h-screen bg-gradient-to-b pt-2 pb-10 from-green-50 to-blue-50">
      {/* Search Bar */}
      <div className="top-0 z-10">
        <div className="container mx-auto px-4 ">
          <div className="relative">
            <input
              type="text"
              placeholder="Search for a category..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full px-4 py-2 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400 focus:border-transparent transition duration-300 ease-in-out"
            />
            <svg
              className="absolute right-3 top-2.5 h-5 w-5 text-gray-400"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"
              ></path>
            </svg>
          </div>
        </div>
      </div>

      {/* Image Carousel */}
      <div className="relative w-full h-[450px] overflow-hidden mt-2">
        {images.map((src, index) => (
          <img
            key={index}
            src={src}
            alt={`Slide ${index + 1}`}
            className={`absolute top-0 left-0 w-full h-full    transition-transform duration-500 ease-in-out ${
              index === currentImage ? "translate-x-0" : "translate-x-full"
            }`}
          />
        ))}
      </div>

      {/* Welcome Message */}
      <div className="container mx-auto px-4 py-12">
        <div className="text-center px-4 py-8 text-2xl font-semibold text-blue-800 bg-white bg-opacity-70 rounded-lg shadow-lg">
          Welcome to our amazing Marketplace! Find a wide variety of products
          from different categories.
        </div>

        {/* Categories */}
        <h2 className="text-4xl font-bold my-8 text-center text-blue-800">
          Explore Categories
        </h2>
        <div className="flex flex-wrap justify-center gap-8">
          {filteredCategories.map((category, index) => (
            <NavLink
              to={`/category/${category.slug}`}
              key={index}
              className="group"
            >
              <div className="flex flex-col items-center transition-transform duration-300 ease-in-out transform hover:scale-105">
                <div className="w-28 h-28 md:w-36 md:h-36 rounded-full overflow-hidden mb-4 border-4 border-white shadow-lg">
                  <img
                    src={category.image}
                    alt={category.name}
                    className="object-cover w-full h-full transition-transform duration-300 ease-in-out transform group-hover:scale-110"
                  />
                </div>
                <span className="text-sm md:text-base font-semibold text-center text-blue-700 group-hover:text-blue-900 transition-colors duration-300">
                  {category.name}
                </span>
              </div>
            </NavLink>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AllProducts;
